import React from "react";
import "./footer.css";
function Footer() {
  return (
    <footer>
      <div className="container">
        <span className="text-muted">
          &copy; Copyright Jeopardy 2020 BootCamp Game
        </span>
      </div>
    </footer>
  );
}
export default Footer;
